import { Link } from 'react-router-dom';

const Damac = () => {
  return (
    <div className="wrap">
      <div className="damac">
        <div className="title">DAMAC Properties</div>
        <div className="description">
          Вы можете посмотреть проекты нашего партнера <Link>DAMAC Properties</Link>
        </div>
      </div>
    </div>
  );
};
export default Damac;
